 be forced to miss several games as a result of the injury. Foot concerns are nothing new for Olsen; he fractured his right foot in 2018 and ruptured the plantar fascia in the same foot later that same season before undergoing surgery. Olsen is fortunate in the sense that his latest injury is to the opposite foot, but he sounds like he'll need some extended time off for rest and rehab before potentially gearing up for a return late in the regular season or during the playoffs. While Olsen is sidelined, Will Dissly and Jacob Hollister are expected to handle most of the reps at tight end.\",\"title\":\"Likely out 6-to-8 weeks\"},{\"timeEpochMilli\":\"1606051115000\",\"contents\":\"Welcome to Week 11 RotoBallers. Below are our updated consensusWeek 11 tight end rankings for fantasy football, including some running notes on relevant injuries, player news and rankings updates: Zach ErtzHighly Unlikely To Return For Week 11 T.J. HockensonOff Week 11 Injury Report Noah FantReturns To Practice Thursday Jack Doyle (Concussion) Returns To Practice Greg Olsen Leaves Early, Team Fears Season-Ending Injury Zach ErtzDesignated To Return From IRThese rankings are a consensus from four...\",\"url\":\"https://www.rotoballer.com/updated-week-11-tight-end-rankings/806553\",\"title\":\"Updated Week 11 Tight End Rankings\"}],\"nameFirst\":\"Greg\",\"nameLast\":\"Olsen\",\"proTeam\":{\"abbreviation\":\"SEA\",\"location\":\"Seattle\",\"name\":\"Seahawks\"},\"positionEligibility\":[\"TE\"]},\"requestedGames\":[{\"game\":{\"id\":6299,\"away\":{\"abbreviation\":\"ARI\",\"location\":\"Arizona\",\"name\":\"Cardinals\"},\"home\":{\"abbreviation\":\"SEA\",\"location\":\"Seattle\",\"name\":\"Seahawks\"},\"startTimeEpochMilli\":\"1605835200000\",\"status\":\"FINAL_SCORE\",\"awayScore\":21,\"homeScore\":28,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"WIN\",\"awayResult\":\"LOSE\"},\"stats\":[{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"na